INSERT INTO `requerimientos_detallerequerimiento` VALUES (1,'Cordial saludo, se realiza el ajuste requerido, por favor revisar y cualquier novedad o inconveniente nos informa por este mismo medio.','2025-08-13 21:22:59.099912','',62,1),(2,'Se dio respuesta y solución a lo solicitado','2025-08-13 22:02:47.805032','',53,1),(3,'Buenos días, se realiza explicación de reporte 138 para visualización de la información solicitada. Quedo atento al cierre de requerimiento.','2025-08-14 14:37:37.622757','',19,2),(4,'se dio respuesta a la solicitud ','2025-08-14 14:46:52.455698','',32,2),(5,'Cordial saludo compañero, será que nos puede decir de que corte necesita el plano.','2025-08-14 16:16:31.350331','',62,3),(6,'CON CORTE AL MES ANTERIOR ES DECIR MES DE JULIO DE 2025','2025-08-14 16:32:58.475260','',14,3),(7,'cordial saludo, se hace envio de la información solicitada, tener encuentra que se envía encriptada por lo cual a su WhatsApp personal se envía la contraseña de desencriptación, cualquier duda nos la comenta y si el envio de esta respuesta soluciona su requerimiento por favor marcar como cerrado el caso, quedamos atentos a cualquier información.','2025-08-14 19:28:28.419445','adjuntos/plano_juridicos.zip',62,3),(8,'Cordial saludo se monta caso en la mesa de ayuda de visionamos con el siguiente numero Caso N° 131784 / IM-131784-1-73861, se estará informando cualquier novedad respecto al caso','2025-08-15 14:09:19.427406','',62,4),(9,'Cordial saludo nos responden de visionamos lo siguiente \r\n\r\n\"Cordial saludo,\r\n\r\nEn el pantallazo no muestra que el error este indicando que el usuario quede inactivo o bloqueado, adicional en el fondo se ve como si la persona estuviera ingresando a la app más no realizando transferencias interbancarias se evidencia que realizo una el 06 de agosto que tuvo novedad en su procesamiento, pero no hay más intentos.\r\n\r\nSi la persona puede enviar un video de cuando realiza la transacción que queda en estado bloqueado seria de gran ayuda para validar dicha novedad, porque se evidencia que esta activa con normalidad, o de ser el caso que aclare cual es el inconveniente puntual.\r\n\r\nQuedo atenta. \" \r\n\r\npara que por favor contacte al asociado y realizar los respectivos soportes o informarnos por este medio si el caso ya se soluciono para informar a visionamos y darle cerrar a este caso gracias','2025-08-15 14:11:16.005772','',62,4),(10,'Cordial saludo compañero, ya se envía personal técnico especializado para el remplazo del tóner, confirmar si se soluciona el inconveniente y darle cerrar caso decir necesario.','2025-08-15 17:00:25.245125','',62,5),(11,'Cordial saludo, se realiza el respectivo cambio de fecha según lo solicitado, por favor revisar si tiene algún inconveniente nos los hace saber, si por el contrario todo esta correcto, le sugerimos que de por cerrado el caso, quedamos atentos a sus comentarios.','2025-08-15 19:19:36.271450','',62,6),(12,'Buenas tardes, se realiza el reinicio de los servicios.','2025-08-15 19:53:02.190422','',19,5),(13,'OK','2025-08-15 21:09:49.245776','',43,6),(14,'Solucionado...','2025-08-15 22:27:26.577650','',15,5),(15,'se da por cerrado el caso por limite de tiempo','2025-08-19 15:01:10.561546','',62,3),(16,'se procede a cerrar caso ya que se cumple con la respuesta del requerimiento','2025-08-19 15:02:07.108003','',62,7),(17,'Cordial saludo, se procede a cambiar la fecha solicitada, se recomienda verificar y revisar si algo esta mal informar por este mismo medio, de lo contrario esta respuesta soluciona su requerimiento lo invitamos a dar cierre del caso, quedamos atentos a sus comentarios.','2025-08-19 15:03:14.619534','',62,8),(18,'Cordial saludo,\r\nSe realiza alistamiento de tarjetas, cantidad 100. \r\nInicio: 5035\r\nHasta: 6025  \r\nUna vez se realice el despacho se informará.','2025-08-20 16:53:24.448984','',19,9),(19,'se procede a montar caso a la mesa de ayuda de visionamos \r\nCaso IM-132666-1-74247, cualquier novedad la haremos saber por este mismo medio, si desean consultar el estado del caso alli dejo el numero del caso.','2025-08-20 21:16:17.865071','',62,12),(20,'compañera nos confirma si podemos dar apertura de cierre al caso.','2025-08-20 21:17:40.853064','',62,8),(21,'gracias compañero','2025-08-20 21:50:49.075681','',51,4),(22,'Buenos días. el servicio se reestableció el día de ayer, Director de Agencia informo mejora en la conexión a las 4:49 del día 20 de agosto de 2025.','2025-08-21 15:15:32.844050','',19,11),(23,'Cordial saludo, se reestablece el canal de respaldo de internet para conexión por FortiClient. Se están realizando validaciones del servicio principal con Movistar.','2025-08-21 16:04:03.552881','',19,13),(24,'SE procede a cerrar caso, por cuanto no se ha tenido respuesta por parte del colaborador.','2025-08-21 19:44:06.179157','',62,8),(25,'se procede a cerrar el caso','2025-08-21 19:44:56.517412','',62,11),(26,'Cordial saludo, se hace envio del archivo solicitado con su respectiva encriptación, la contraseña será enviada por WhatsApp a la persona encargada. Por favor revisar el archivo, cualquier duda nos la hace saber por este mismo caso, si la solución planteada satisface las necesidades del requerimiento lo invitamos a dar cierre del caso, quedamos atentos a cualquier novedad.','2025-08-21 19:47:33.537872','adjuntos/base_asociados_activos.zip',62,14),(27,'Cordial saludo, se hace reinicio del servicio de cola de impresión, si la solución planteada satisface las necesidades del requerimiento la invitamos a dar cierre al caso, de lo contrario nos informa por este mismo medio.','2025-08-21 19:48:54.586439','',62,15);
